import React from 'react';

function FormButton(props) {
  const scriptName = props.script;
  const errors = props.error;
  const numOfAccounts = props.numAcc;
  return (
    <input
      className="submitButton"
      type="button"
      value="SIGN UP"
      onClick={() => {
        onSubmit(scriptName, errors, numOfAccounts);
      }}
    ></input>
  );
}
function onSubmit(scriptName, errors, numOfAccounts) {
  fetch('http://localhost:9000/batch-executions/regression', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
      'Access-Control-Allow-Origin': '*',
    },
    //  body: { "numberOfAccountsPerErrorCode": {numOfAccounts},
    //  "script": {scriptName},
    //  "requestType": "V1",
    //  "aggregate": true,
    //  "ticketsNumber": ["1062273","1062333"],
    //  "errorCodes": [{errors}],
    //  "additionalEntities": [] }
    body: {
      numberOfAccountsPerErrorCode: 10,
      script: 'schwab.scr',
      requestType: 'V1',
      aggregate: true,
      ticketsNumber: ['1062273', '1062333'],
      errorCodes: ['103', '102', '0'],
      additionalEntities: [],
    },
  })
    .then((response) => {
      return response.json();
    })
    .then((jsonObject) => {
      console.log(jsonObject);
    });
  // fetch('https://api.chucknorris.io/jokes/random')
  // .then((response) => {
  // return response.json();
  // })
  // .then((jsonObject) =>
  // { console.log(jsonObject.value);
  //   console.log("script name id: "+scriptName+ " errors are: "+errors+" Account:"+numOfAccounts);
  // });
}

export default FormButton;
